def ReverseComplement(Text):
    compliment = ''
    for i in Text:
        if i == 'A':
            compliment+='T'
        if i == 'T':
            compliment+='A'
        if i == 'G':
            compliment+='C'
        if i == 'C':
            compliment+='G'
    Revcompliment = ''
    for i in range(1,len(Text)+1):
        Revcompliment+=compliment[-i]
    return Revcompliment
print(ReverseComplement(''))